import Header from '../components/header';

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
  };

const Layout = (props) => {
    return ( 
        <div style={layoutStyle}>
            <Header />
            
        </div>
     );
}
 
export default Layout;
